import React from 'react';

function ExpenseList({ expenses, onDeleteExpense }) {
  return (
    <div>
    <h2 className="font-bold mb-4">지출 목록</h2>
    <ul>
        {expenses.map((expense) => (
        <li key={expense.id} className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4 flex justify-between items-center">
            <span>{expense.name} - ${expense.cost}</span>
            <button onClick={() => onDeleteExpense(expense.id)} className="bg-red-500 hover:bg-red-700 text-white font-bold py-1 px-2 rounded">
            삭제
            </button>
        </li>
        ))}
    </ul>
    </div>
  );
}

export default ExpenseList;
